INSERT INTO `bands` (`id`, `band_name`, `band_info`, `genre_id`, `facebook`, `twitter`, `official_site`, `created`) VALUES
(1, 'Coldplay', 'Coldplay are a British rock band formed in 1996 by lead vocalist Chris Martin and lead guitarist Jonny Buckland at University College London. After they formed under the name Pectoralz, Guy Berryman joined the group as a bassist and they changed their name to Starfish. Will Champion joined as a drummer, backing vocalist, and multi-instrumentalist, completing the line-up. Manager Phil Harvey is often considered an unofficial fifth member. The band renamed themselves "Coldplay" in 1998, before recording and releasing three EPs; Safety in 1998, Brothers & Sisters as a single in 1999 and The Blue Room in the same year. The latter was their first release on a major label, after signing to Parlophone.', 24, 'http://www.facebook.com/coldplay', 'http://www.twitter.com/coldplay', 'http://www.coldplay.com', '2013-10-19 17:22:00');
